// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

interface IVehicleRegistry {
    function getVehicle(string memory inspectionId) external view returns (
        string memory registrationNumber,
        address owner,
        string memory registrationTxHash,
        bool isRegistered
    );
    
    function isVehicleOwner(string memory inspectionId, address user) external view returns (bool);
}

contract VehicleNFT is ERC721, ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    
    Counters.Counter private _tokenIdCounter;
    
    // Reference to the Vehicle Registration Contract
    IVehicleRegistry public vehicleRegistry;
    
    // Mapping from inspection ID to token ID
    mapping(string => uint256) public inspectionToTokenId;
    
    // Mapping from token ID to inspection ID
    mapping(uint256 => string) public tokenIdToInspection;
    
    // Mapping to track if NFT was minted for inspection ID
    mapping(string => bool) public nftMinted;
    
    // Events
    event VehicleNFTMinted(
        uint256 indexed tokenId, 
        string indexed inspectionId, 
        address indexed owner,
        string tokenURI
    );
    
    event RegistryUpdated(address indexed oldRegistry, address indexed newRegistry);
    
    constructor(address _vehicleRegistry) ERC721("Vehicle Certificate NFT", "VCNFT") {
        vehicleRegistry = IVehicleRegistry(_vehicleRegistry);
    }
    
    /**
     * @dev Mint NFT for a registered vehicle
     * @param inspectionId The vehicle inspection ID
     * @param to Address to mint NFT to
     * @param tokenURI Metadata URI for the NFT
     */
    function mintVehicleNFT(
        string memory inspectionId,
        address to,
        string memory tokenURI
    ) public returns (uint256) {
        // Verify vehicle is registered
        (, , , bool isRegistered) = vehicleRegistry.getVehicle(inspectionId);
        require(isRegistered, "Vehicle not registered");
        
        // Verify caller is the vehicle owner or contract owner
        require(
            vehicleRegistry.isVehicleOwner(inspectionId, msg.sender) || 
            msg.sender == owner(),
            "Not authorized to mint NFT for this vehicle"
        );
        
        // Check if NFT already minted
        require(!nftMinted[inspectionId], "NFT already minted for this vehicle");
        
        // Mint the NFT
        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();
        
        _safeMint(to, tokenId);
        _setTokenURI(tokenId, tokenURI);
        
        // Update mappings
        inspectionToTokenId[inspectionId] = tokenId;
        tokenIdToInspection[tokenId] = inspectionId;
        nftMinted[inspectionId] = true;
        
        emit VehicleNFTMinted(tokenId, inspectionId, to, tokenURI);
        
        return tokenId;
    }
    
    /**
     * @dev Get token ID for a given inspection ID
     */
    function getTokenIdByInspection(string memory inspectionId) 
        public 
        view 
        returns (uint256) 
    {
        require(nftMinted[inspectionId], "NFT not minted for this inspection");
        return inspectionToTokenId[inspectionId];
    }
    
    /**
     * @dev Get inspection ID for a given token ID
     */
    function getInspectionByTokenId(uint256 tokenId) 
        public 
        view 
        returns (string memory) 
    {
        require(_exists(tokenId), "Token does not exist");
        return tokenIdToInspection[tokenId];
    }
    
    /**
     * @dev Check if NFT exists for inspection ID
     */
    function nftExistsForInspection(string memory inspectionId) 
        public 
        view 
        returns (bool) 
    {
        return nftMinted[inspectionId];
    }
    
    /**
     * @dev Get vehicle details linked to token
     */
    function getVehicleDetails(uint256 tokenId) 
        public 
        view 
        returns (
            string memory registrationNumber,
            address vehicleOwner,
            string memory registrationTxHash,
            bool isRegistered,
            string memory inspectionId
        ) 
    {
        require(_exists(tokenId), "Token does not exist");
        
        string memory inspection = tokenIdToInspection[tokenId];
        (registrationNumber, vehicleOwner, registrationTxHash, isRegistered) = 
            vehicleRegistry.getVehicle(inspection);
        
        return (registrationNumber, vehicleOwner, registrationTxHash, isRegistered, inspection);
    }
    
    /**
     * @dev Update vehicle registry contract address (only owner)
     */
    function updateVehicleRegistry(address _newRegistry) public onlyOwner {
        address oldRegistry = address(vehicleRegistry);
        vehicleRegistry = IVehicleRegistry(_newRegistry);
        emit RegistryUpdated(oldRegistry, _newRegistry);
    }
    
    /**
     * @dev Get total number of minted NFTs
     */
    function totalSupply() public view returns (uint256) {
        return _tokenIdCounter.current();
    }
    
    /**
     * @dev Override required by Solidity for multiple inheritance
     */
    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
        
        // Clean up mappings
        string memory inspectionId = tokenIdToInspection[tokenId];
        delete inspectionToTokenId[inspectionId];
        delete tokenIdToInspection[tokenId];
        delete nftMinted[inspectionId];
    }
    
    /**
     * @dev Override required by Solidity for multiple inheritance
     */
    function tokenURI(uint256 tokenId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (string memory)
    {
        return super.tokenURI(tokenId);
    }
    
    /**
     * @dev Override required by Solidity for multiple inheritance
     */
    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, ERC721URIStorage)
        returns (bool)
    {
        return super.supportsInterface(interfaceId);
    }
}

